    data: |
      SELECT - col2 / ( + col2 ) * - - col2 AS col0, + 89 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q10738.out
    data: |
      -59	89
      -68	89
      -96	89
